        break;
    case 9:
        monthName = "September";
        break;
    case 10:
        monthName = "October";
        break;
    case 11:
        monthName = "November";
        break;
    case 12:
        monthName = "December";
        break;
    default:
        monthName = "Invalid month";
}

console.log(monthName); // September

let year = 2000;
let month = 2;
let days = 0;

switch (month) {
    case 1:
    case 3:
    case 5:
    case 7:
    case 8:
    case 10:
    case 12:
        days = 31;
        break;
    case 4:
    case 6:
    case 9:
    case 11:
        days = 30;
        break;
    case 2:
        days =
            (year % 4 === 0 && year % 100 !== 0) || year % 400 === 0 ? 29 : 28;
        break;
    default:
        console.log("Invalid month");
}

console.log(days); // 29

