Edit book.json file:
{
    "title": "Web Development Book",
    "description": "HTML CSS JS CS 정리",
    "author": "Woochul Hyun",
    "language": "en, ko",
    "root": ".",
    "structure": {
        "summary": "SUMMARY.md"
    },
    "links": {
        "sidebar": {
            "GitHub": "https://github.com/WooChulHyun"
        }
    },
    "styles": {
        "website": "styles/website.css"
    }
}
